import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import MyNavbar from "./components/MyNavbar";
import SubNavbar from "./components/SubNavbar";
import MyFooter from "./components/MyFooter";

function App() {
  return (
    <div className="App">
      <MyNavbar />
      <SubNavbar />
      <MyFooter />
    </div>
  );
}

export default App;
